import React from 'react';
import styled from 'styled-components';

// type ListProps<T> = {
//     children: T
//     class: string
// };

const List = (ListContent: any, className: string) => {
    return (children: any) => (
        <ul className={className}>
                <ListContent>{children}</ListContent>
        </ul>
    );
};

export default List;
